"""

value_or_nil = fn
  "" -> nil
  value -> value
end

jason_decode_or_nil = fn
  "" -> nil
  value -> Jason.decode!(value) |> Enum.reject(fn {_key, v} -> is_nil(v) end) |> Enum.into(%{})
end

strip_nils = fn
  nil -> nil
  map -> map |> Enum.reject(fn {_key, v} -> is_nil(v) end) |> Enum.into(%{})
end

csv
|> CSV.parse_string(skip_headers: false)
|> Enum.map(fn [
                 _id,
                 slug,
                 display_name,
                 sort_name,
                 showcased,
                 _tenant_id,
                 disambig_chars,
                 profession,
                 avatar_url,
                 dob_partial_date,
                 dod_partial_date,
                 _inserted_at,
                 _updated_at,
                 japanese_name,
                 _alternate_names,
                 birth_place_map,
                 death_place_map,
                 cause_of_death
               ] ->
  decoded_dob_partial_date =
    dob_partial_date
    |> jason_decode_or_nil.()
    |> strip_nils.()

  if decoded_dob_partial_date, do: dbg(decoded_dob_partial_date)

  decoded_dod_partial_date =
    dod_partial_date
    |> jason_decode_or_nil.()
    |> strip_nils.()

  if decoded_dod_partial_date, do: dbg(decoded_dod_partial_date)

  decoded_birth_place_map =
    jason_decode_or_nil.(birth_place_map)

  decoded_death_place_map =
    jason_decode_or_nil.(death_place_map)

  {dob, dob_resolution} =
    case decoded_dob_partial_date do
      nil -> {nil, nil}
      %{"unknown" => true} -> {nil, :unknown}
      %{"day" => day, "month" => month, "year" => year} -> {Date.new!(year, month, day), :day}
      %{"month" => month, "year" => year} -> {Date.new!(year, month, 1), :month}
      %{"year" => year} -> {Date.new!(year, 1, 1), :year}
      %{} -> {nil, nil}
    end

  {dod, dod_resolution} =
    case decoded_dod_partial_date do
      nil -> {nil, nil}
      %{"unknown" => true} -> {nil, :unknown}
      %{"day" => day, "month" => month, "year" => year} -> {Date.new!(year, month, day), :day}
      %{"month" => month, "year" => year} -> {Date.new!(year, month, 1), :month}
      %{"year" => year} -> {Date.new!(year, 1, 1), :year}
      %{} -> {nil, nil}
    end

  birth_place =
    decoded_birth_place_map
    |> Map.take(["country", "country_subdivision", "city"])
    |> then(&[&1["city"], &1["country_subdivision"], &1["country"]])
    |> Enum.reject(&is_nil(&1))
    |> Enum.join(", ")
    |> then(&value_or_nil.(&1))

  death_place =
    decoded_death_place_map
    |> Map.take(["country", "country_subdivision", "city"])
    |> then(&[&1["city"], &1["country_subdivision"], &1["country"]])
    |> Enum.reject(&is_nil(&1))
    |> Enum.join(", ")
    |> then(&value_or_nil.(&1))

  %{
    slug: slug,
    display_name: display_name,
    sort_name: sort_name,
    showcased: showcased,
    disambig_chars: value_or_nil.(disambig_chars),
    profession: value_or_nil.(profession),
    avatar_url: value_or_nil.(avatar_url),
    dob: dob,
    dob_resolution: dob_resolution,
    dod: dod,
    dod_resolution: dod_resolution,
    japanese_name: value_or_nil.(japanese_name),
    birth_place: birth_place,
    death_place: death_place,
    cause_of_death: value_or_nil.(cause_of_death)
  }
end)
|> Ash.bulk_create!(Cineaste.Library.Person, :create, return_errors?: true)
